        /// <summary>
        /// To set Login User ID
        /// </summary>
        private void SetUpLoginUser()
        {
            Prana.BusinessObjects.Authorization.NirvanaPrincipal authorizedPrincipal = AuthorizationManager.GetInstance()._authorizedPrincipal;
            if (authorizedPrincipal != null)
            {
                _LoginUserID = authorizedPrincipal.UserId;
                _LoginUserRole = authorizedPrincipal.Role;
            }
        }

        /// <summary>
        /// TO apply gradient theme in groupboxes
        /// </summary>
        private void PaintGradient()
        {
            try
            {
                System.Drawing.Drawing2D.LinearGradientBrush gradBrush;
                gradBrush = new System.Drawing.Drawing2D.LinearGradientBrush(new Point(0, 0), new Point(this.Width, this.Height), System.Drawing.Color.Black, System.Drawing.Color.LightGray);
                Bitmap bmp = new Bitmap(this.Width, this.Height);
                Graphics g = Graphics.FromImage(bmp);
                g.FillRectangle(gradBrush, new Rectangle(0, 0, this.Width, this.Height));

                //this.BackColor = System.Drawing.Color.Transparent;
                this.BackgroundImage = bmp;
                this.BackgroundImageLayout = ImageLayout.Stretch;

                this.gpbDetails.BackColor = System.Drawing.Color.Transparent;
                this.gpbDetails.BackgroundImage = bmp;
                this.gpbDetails.BackgroundImageLayout = ImageLayout.Stretch;
                this.gpbDetails.ForeColor = System.Drawing.Color.White;

                this.gpbPrimaryContact.BackColor = System.Drawing.Color.Transparent;
                this.gpbPrimaryContact.BackgroundImage = bmp;
                this.gpbPrimaryContact.BackgroundImageLayout = ImageLayout.Stretch;
                this.gpbPrimaryContact.ForeColor = System.Drawing.Color.White;
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
        }



