        bool _prefstatus = false;
        void trvAccountGroups_AfterSelect(object sender, TreeViewEventArgs e)
        {
            String groupName = String.Empty;
            try
            {
                NodeDetails nodeDetails = (NodeDetails)trvAccountGroups.SelectedNode.Tag;
                if (nodeDetails == null)
                {
                    MessageBox.Show("Select Some node!");
                    tbcCompanyMaster.Enabled = false;
                }
                else
                {

                    EnableCompanyTabs();
                    int GroupID = nodeDetails.NodeID;
                    if (GroupID != int.MinValue)
                    {
                        groupName = trvAccountGroups.SelectedNode.Text;
                    }

                    // GroupID = 6;
                    accountGroupSetup1.InitializeControl(GroupID, groupName);

                }
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
        }

        void trvUsers_AfterSelect(object sender, TreeViewEventArgs e)
        {
            int userID = int.MinValue;
            int roleID = (int)NirvanaRoles.User;
            try
            {
                NodeDetails nodeDetails = (NodeDetails)trvUsers.SelectedNode.Tag;
                //DataTable dtCompaniesList = CachedDataManager.GetInstance.GetCompany();

                if (nodeDetails == null)
                {
                    MessageBox.Show("Select Some node!");
                    tbcCompanyMaster.Enabled = false;
                }
                else if (nodeDetails.Type != NodeType.Roles)
                {
                    EnableCompanyTabs();
                    userID = nodeDetails.NodeID;
                    NodeDetails nodeDetailsParentRole = (NodeDetails)trvUsers.SelectedNode.Parent.Tag;
                    roleID = Convert.ToInt32(nodeDetailsParentRole.NodeID);
                }
                else if (nodeDetails.Type == NodeType.Roles && nodeDetails.NodeID != int.MinValue)
                {
                    userID = int.MinValue;
                    roleID = Convert.ToInt32(nodeDetails.NodeID);
                }
                if (userID > 0)
                {
                    userSetup1.Enabled = true;
                    userSetup1.InitializeControl(userID, roleID);
                    int companyIDForUser = userSetup1.getUserCompanyID();
                    Modules companyUserModules = ModuleManager.GetModulesForCompanyUser(userID);
                    uctCompanyUserPermissions.SetupControl(companyIDForUser, userID, companyUserModules);
                    uctComplianceUserPermissions.SetUpControl(companyIDForUser, userID, companyUserModules);
                }
                else
                {
                    userSetup1.InitializeControl(int.MinValue, roleID);
                    userSetup1.Enabled = false;
                }

            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
