        /// <summary>
        /// This method saves the company on the click event of the button in the form while applying the
        /// validations on the required fields by checking for the null values or some other validation.
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnSaveCompanySetup_Click(object sender, System.EventArgs e)
        {
            try
            {
                NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                int result = int.MinValue;
                if (tbcCompanySetup.SelectedTab.Key == "tbpCopyPreferences")
                {
                    SavePreferences();
                    if (_prefstatus)
                        MessageBox.Show(this, "Preference saved", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    return;
                }
                if (tbcCompanySetup.SelectedTab.Key == "tbpShortLocatePreferences")
                {
                    ctrlShortLocatePreference1.Save();
                    return;
                }
                if (_isAddingNewCompany)
                {
                    result = SaveCompanyDetails(nodeDetails.CompanyID);
                    if (result > 0)
                    {
                        _isAddingNewCompany = false;
                        nodeDetails.NodeID = result;
                        SelectTreeNode(nodeDetails);
                    }
                }
                else
                {
                    result = SaveCompany();
                }

                if (result > 0)
                {
                    MessageBox.Show(this, "Client saved", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Information);
                }

            }
            #region Catch
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);

                if (rethrow)
                {
                    throw;
                }
            }
            #endregion
            finally
            {
                #region LogEntry

                //Logger.LoggerWrite("btnSaveCompanySetup_Click", 
                //    LoggingConstants.LOG_CATEGORY_UI, 1, 1, System.Diagnostics.TraceEventType.Information,
                //    FORM_NAME + "btnSaveCompanySetup_Click", null);  
                // 

                #endregion
            }
        }
        private int SaveCompany()
        {
            int result = int.MinValue;
            int selCompanyID = int.MinValue;
            try
            {
                //bool isCompanyValue = false;
                //Regex emailRegex = new Regex("(?<user>[^@]+)@(?<host>.+)");
                string emailCheck = @"\w+([-+.]\w+)*@\w+([-.]\w+)*\.\w+([-.]\w+)*";
                //string emailAlertCheck = @"(([a-zA-Z0-9_\-\.]+)@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.)|(([a-zA-Z0-9\-]+\.)+))([a-zA-Z]{2,4}|[0-9]{1,3})(\]?)(\s*;\s*|\s*$))*";
                Regex emailRegex = new Regex(emailCheck);

                if (trvCompanyMaster.SelectedNode != null)
                {
                    NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;


                    //Save Company details.
                    //-----------------------------------------------------------------------------
                    Prana.Admin.BLL.Company company = new Prana.Admin.BLL.Company();

                    //Match emailMatch = new Match();
                    Match emailMatchPC1 = emailRegex.Match(txtPC1Email.Text.ToString());
                    Match emailMatchPC2 = emailRegex.Match(txtPC2Email.Text.ToString());
                    Match emailMatchTC = emailRegex.Match(txtTCEmail.Text.ToString());
                    Match emailAlertMatchPC = emailRegex.Match(string.Empty);
                    if (txtEmailAlert.Text.Length > 0)
                    {
                        string emailList = txtEmailAlert.Text.ToString();
                        foreach (var email in emailList.Split(new char[] { ';' }, StringSplitOptions.RemoveEmptyEntries))
                        {
                            emailAlertMatchPC = emailRegex.Match(email);
                            if (!emailAlertMatchPC.Success)
                                break;
                        }
                    }

                    errorProvider1.SetError(txtCompanyName, "");
                    errorProvider1.SetError(txtShortName, "");
                    errorProvider1.SetError(txtPC1Email, "");
                    errorProvider1.SetError(txtEmailAlert, "");
                    errorProvider1.SetError(txtTelephone, "");
                    errorProvider1.SetError(txtPC1Telephone, "");
                    errorProvider1.SetError(txtPC1Cell, "");
                    errorProvider1.SetError(txtFax, "");
                    errorProvider1.SetError(txtZip, "");
                    errorProvider1.SetError(txtLogin, "");
                    errorProvider1.SetError(txtPassword, "");
                    errorProvider1.SetError(txtAddress2, "");
                    errorProvider1.SetError(cmbCompanyTYpe, "");
                    errorProvider1.SetError(txtPC2Email, "");
                    errorProvider1.SetError(txtTCEmail, "");

                    errorProvider1.SetError(cmbTimeZone, "");

                    if (txtCompanyName.Text == "")
                    {
                        errorProvider1.SetError(txtCompanyName, "Please enter Client Name!");
                        tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                        txtCompanyName.Focus();
                        return result;
                    }
                    if (txtShortName.Text == "")
                    {
                        errorProvider1.SetError(txtShortName, "Please enter Short Name!");
                        tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                        txtShortName.Focus();
                        return result;
                    }
                    //added by: Bharat Raturi, 21 may 2014
                    //purpose: To validate the length of the short name
                    if (txtShortName.Text.Length > 5)
                    {
                        errorProvider1.SetError(txtShortName, "Short Name cannot be more than 5 characters!");
                        tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                        txtShortName.Focus();
                        return result;
                    }
                    if (!(String.IsNullOrEmpty(txtTelephone.Text)) && txtTelephone.Text.Any(Char.IsLetter))
                    {
                        errorProvider1.SetError(txtTelephone, "Please enter numeric values only.");
                        tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                        txtTelephone.Focus();
                        return result;
                    }
                    if (!(String.IsNullOrEmpty(txtPC1Telephone.Text)) && txtPC1Telephone.Text.Any(Char.IsLetter))
                    {
                        errorProvider1.SetError(txtPC1Telephone, "Please enter numeric values only.");
                        tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                        txtPC1Telephone.Focus();
                        return result;
                    }
                    if (!(String.IsNullOrEmpty(txtPC1Cell.Text)) && txtPC1Cell.Text.Any(Char.IsLetter))
                    {
                        errorProvider1.SetError(txtPC1Cell, "Please enter numeric values only.");
                        tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                        txtPC1Cell.Focus();
                        return result;
                    }
                    if (!(String.IsNullOrEmpty(txtFax.Text)) && txtFax.Text.Any(Char.IsLetter))
