        /// <summary>
        /// Function to get Strategy ID
        /// </summary>
        /// <param name="SelectedMasterFundID"></param>
        //[AuditManager.Attributes.AuditRefreshMethAttri(AuditManager.Attributes.AuditMehodType.Arguments, 0)]
        //public void RefreshStrategyAuditFor(int SelectedStrategyID) { }
        /// <summary>
        /// 
        /// </summary>
        /// <param name="strategyAuditStatus"></param>
        private void AuditMasterStrategyData(Dictionary<int, List<int>> strategyAuditStatus)
        {
            try
            {
                if (strategyAuditStatus != null)
                {
                    foreach (KeyValuePair<int, List<int>> status in strategyAuditStatus)
                    {
                        if (status.Key == 1)
                        {
                            foreach (int strategyID in strategyAuditStatus[1])
                                AuditManager.BLL.AuditHandler.GetInstance().AuditDataForGivenInstance(masterStrategyMapping1, GetStrategyAuditData(CachedDataManager.GetInstance.GetCompanyID(), strategyID), AuditManager.Definitions.Enum.AuditAction.StrategyCreated);
                        }
                        else if (status.Key == 2)
                        {
                            foreach (int strategyID in strategyAuditStatus[2])
                                AuditManager.BLL.AuditHandler.GetInstance().AuditDataForGivenInstance(masterStrategyMapping1, GetStrategyAuditData(CachedDataManager.GetInstance.GetCompanyID(), strategyID), AuditManager.Definitions.Enum.AuditAction.StrategyDeleted);
                        }
                        else if (status.Key == 3)
                        {
                            foreach (int strategyID in strategyAuditStatus[3])
                                AuditManager.BLL.AuditHandler.GetInstance().AuditDataForGivenInstance(masterStrategyMapping1, GetStrategyAuditData(CachedDataManager.GetInstance.GetCompanyID(), strategyID), AuditManager.Definitions.Enum.AuditAction.StrategyUpdated);
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);

                if (rethrow)
                {
                    throw;
                }
            }
        }
        /// <summary>
        /// Function to get dictionary for details of strategy
        /// </summary>
        /// <param name="_companyID"></param>
        /// <returns></returns>

        private Dictionary<String, List<String>> GetStrategyAuditData(int companyID, int strategyID)
        {
            Dictionary<String, List<String>> auditDataForStrategy = new Dictionary<string, List<string>>();
            try
            {
                auditDataForStrategy.Add(CustomAuditSourceConstants.AuditSourceTypeStrategy, new List<string>());
                auditDataForStrategy[CustomAuditSourceConstants.AuditSourceTypeStrategy].Add(companyID.ToString());
                auditDataForStrategy[CustomAuditSourceConstants.AuditSourceTypeStrategy].Add(strategyID.ToString());
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);

                if (rethrow)
                {
                    throw;
                }
            }
            return auditDataForStrategy;
        }

