        /// <summary>
        /// save compnay details name, address
        /// </summary>
        /// <returns></returns>
        private int SaveCompanyDetails(int CompanyID)
        {
            int result = int.MinValue;
            try
            {
                string emailCheck = @"\w+([-+.]\w+)*@\w+([-.]\w+)*\.\w+([-.]\w+)*";
                Regex emailRegex = new Regex(emailCheck);
                //Save Company details.
                //-----------------------------------------------------------------------------
                Prana.Admin.BLL.Company company = new Prana.Admin.BLL.Company();
                //Match emailMatch = new Match();
                Match emailMatchPC1 = emailRegex.Match(txtPC1Email.Text.ToString());
                Match emailMatchPC2 = emailRegex.Match(txtPC2Email.Text.ToString());
                Match emailMatchTC = emailRegex.Match(txtTCEmail.Text.ToString());
                Match emailAlertMatchPC = emailRegex.Match(string.Empty);
                if (txtEmailAlert.Text.Length > 0)
                {
                    string emailList = txtEmailAlert.Text.ToString();
                    foreach (var email in emailList.Split(new char[] { ';' }, StringSplitOptions.RemoveEmptyEntries))
                    {
                        emailAlertMatchPC = emailRegex.Match(email);
                        if (!emailAlertMatchPC.Success)
                            break;
                    }
                }

                errorProvider1.SetError(txtCompanyName, "");
                errorProvider1.SetError(txtShortName, "");
                errorProvider1.SetError(txtPC1Email, "");
                errorProvider1.SetError(txtPC2Email, "");
                errorProvider1.SetError(txtTCEmail, "");
                errorProvider1.SetError(txtTelephone, "");
                errorProvider1.SetError(txtPC1Telephone, "");
                errorProvider1.SetError(txtPC1Cell, "");
                errorProvider1.SetError(txtFax, "");
                errorProvider1.SetError(txtZip, "");

                errorProvider1.SetError(txtLogin, "");
                errorProvider1.SetError(txtPassword, "");
                errorProvider1.SetError(txtAddress2, "");
                errorProvider1.SetError(cmbCompanyTYpe, "");
                errorProvider1.SetError(cmbTimeZone, "");

                if (txtCompanyName.Text == "")
                {
                    errorProvider1.SetError(txtCompanyName, "Please enter Client Name!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtCompanyName.Focus();
                    return result;
                }
                if (txtShortName.Text == "")
                {
                    errorProvider1.SetError(txtShortName, "Please enter Short Name!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtShortName.Focus();
                    return result;
                }
                if (txtShortName.Text.Length > 5)
                {
                    errorProvider1.SetError(txtShortName, "Short Name cannot be more than 5 characters!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtShortName.Focus();
                    return result;
                }
                if (!(String.IsNullOrEmpty(txtTelephone.Text)) && txtTelephone.Text.Any(Char.IsLetter))
                {
                    errorProvider1.SetError(txtTelephone, "Please enter numeric values only.");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtTelephone.Focus();
                    return result;
                }
                if (!(String.IsNullOrEmpty(txtPC1Telephone.Text)) && txtPC1Telephone.Text.Any(Char.IsLetter))
                {
                    errorProvider1.SetError(txtPC1Telephone, "Please enter numeric values only.");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtPC1Telephone.Focus();
                    return result;
                }
                if (!(String.IsNullOrEmpty(txtPC1Cell.Text)) && txtPC1Cell.Text.Any(Char.IsLetter))
                {
                    errorProvider1.SetError(txtPC1Cell, "Please enter numeric values only.");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtPC1Cell.Focus();
                    return result;
                }
                if (!(String.IsNullOrEmpty(txtFax.Text)) && txtFax.Text.Any(Char.IsLetter))
                {
                    errorProvider1.SetError(txtFax, "Please enter numeric values only.");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtFax.Focus();
                    return result;
                }
                if (!(String.IsNullOrEmpty(txtZip.Text)) && txtZip.Text.Any(Char.IsLetter))
                {
                    errorProvider1.SetError(txtZip, "Please enter numeric values only.");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtZip.Focus();
                    return result;
                }

                if (txtLogin.Text == "")
                {
                    errorProvider1.SetError(txtLogin, "Please enter Login!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtLogin.Focus();
                    return result;
                }
                if (txtPassword.Text == "")
                {
                    errorProvider1.SetError(txtPassword, "Please enter Password!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtPassword.Focus();
                    return result;
                }
                else if (int.Parse(txtPassword.Text.Length.ToString()) < 4)
                {
                    errorProvider1.SetError(txtPassword, "Please enter password having at least four characters!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtPassword.Focus();
                    return result;
                }
                else if (cmbCompanyTYpe.Value == null)
                {
                    errorProvider1.SetError(cmbCompanyTYpe, "Please select Client Type!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    cmbCompanyTYpe.Focus();
                    return result;
                }
                else if (int.Parse(cmbCompanyTYpe.Value.ToString()) == int.MinValue)
                {
                    errorProvider1.SetError(cmbCompanyTYpe, "Please select Client Type!");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    cmbCompanyTYpe.Focus();
                    return result;
                }

                if (txtPC1Email.Text.Trim().Length > 0 && !emailMatchPC1.Success)
                {
                    //errorProvider1.SetError(txtPC1Email, "Please enter Personal Contact1 Email!");
                    errorProvider1.SetError(txtPC1Email, "Please enter valid Email address !");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtPC1Email.Focus();
                    return result;
                }
                else if (txtPC2Email.Text.Trim().Length > 0 && !emailMatchPC2.Success)
                {
                    errorProvider1.SetError(txtPC2Email, "Please enter valid Email address !");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtPC2Email.Focus();
                    return result;
                }
                else if (txtTCEmail.Text.Trim().Length > 0 && !emailMatchTC.Success)
                {
                    errorProvider1.SetError(txtTCEmail, "Please enter valid Email address !");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtTCEmail.Focus();
                    return result;
                }
                else if (cmbTimeZone.Text.Trim() == "")
                {
                    errorProvider1.SetError(cmbTimeZone, "Please select Time Zone !");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    cmbTimeZone.Focus();
                    return result;
                }
                else if (txtEmailAlert.Text.Trim().Length > 0 && !emailAlertMatchPC.Success)
                {
                    //errorProvider1.SetError(txtPC1Email, "Please enter Personal Contact1 Email!");
                    errorProvider1.SetError(txtEmailAlert, "Please enter valid Email addresses !");
                    tbcCompanySetup.SelectedTab = tbcCompanySetup.Tabs[0];
                    txtEmailAlert.Focus();
                    return result;
                }

                else
                {
                    company.CompanyID = CompanyID;
                    company.ShortName = txtShortName.Text;
                    company.LoginName = txtLogin.Text;
                    company.Password = txtPassword.Text;
                    company.Address1 = txtAddress1.Text;
                    company.Address2 = txtAddress2.Text;

                    if (cmbCompanyTYpe.Text.Trim() != String.Empty)
                    {
                        company.CompanyTypeID = int.Parse(cmbCompanyTYpe.Value.ToString());
                    }

                    if (cmbCountry.Text.Trim() != String.Empty)
                    {
                        company.CountryID = int.Parse(cmbCountry.Value.ToString());
                    }
                    if (cmbState.Text.Trim() != String.Empty)
                    {
                        company.StateID = int.Parse(cmbState.Value.ToString());
                    }
                    company.Zip = txtZip.Text;
                    company.Telephone = txtTelephone.Text;
                    company.Fax = txtFax.Text;
                    company.Name = txtCompanyName.Text;
                    company.PrimaryContactCell = txtPC1Cell.Text;
                    company.PrimaryContactFirstName = txtPC1FirstName.Text;
                    company.PrimaryContactLastName = txtPC1LastName.Text;
                    company.PrimaryContactEMail = txtPC1Email.Text;
                    company.PrimaryContactTelephone = txtPC1Telephone.Text;
                    company.PrimaryContactTitle = txtPC1Title.Text;
                    company.City = txtCity.Text;

                    //modified by: Bharat Raturi, Date: 05/Mar/2014
                    //Purpose: Provide details of new field 'Region'
                    //modified by sachin mishra -JIRA no CHMW-2409 for saving region value  20/jan/2015
                    company.Region = txtRegion.Text;

                    //modified by: Bhavana, Date: 29/April/2014
                    //Purpose: Provide details of new field 'TimeZone'
                    company.TimeZone = int.Parse(cmbTimeZone.SelectedIndex.ToString());
                    company.EmailAlert = txtEmailAlert.Text;

                    result = CompanyManager.SaveCompany(company); //result now storing the value of stored companyID.


                    if (result < 0)
                    {
                        MessageBox.Show("Client with the same name already exists.", "Alert", MessageBoxButtons.OK);
                        return result;
                    }
                    else
                    {
                        BindTree();
                        //added by: Bharat raturi, 03 jun 2014
                        //purpose: refresh the client cache on save
                        CachedDataManager.GetInstance.RefreshClientCache();
                        // To audit company save details.
                        AuditManager.BLL.AuditHandler.GetInstance().AuditDataForGivenInstance(clientAudit, company, AuditManager.Definitions.Enum.AuditAction.ClientCreated);
                        clientAudit.InitializeControl(company.CompanyID);
                    }
                }
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDTHROW);

                if (rethrow)
                {
                    throw;
                }
            }
            return result;
        }

        /// <summary>
        /// bind users to User list tree
        /// Created By omshiv, May 2014
        /// </summary>
        private void BindUsersTree()
        {
            try
            {
                //To clear the tree of any node before binding it afresh.
                trvUsers.Nodes.Clear();

                //Create Copmpany nodes.
                //Add label Company.

                //Font font = new Font("Vedana", 8.25F , System.Drawing.FontStyle.Bold);
                Font font = new Font("Tahoma", 11, System.Drawing.FontStyle.Bold, System.Drawing.GraphicsUnit.Pixel);

                TreeNode treeNodeUsers = new TreeNode("Users");
                //Making the root node to bold by assigning it to the font object defined above. 
                treeNodeUsers.NodeFont = font;

                NodeDetails rolenode = new NodeDetails(NodeType.Roles, int.MinValue, int.MinValue);
                treeNodeUsers.Tag = rolenode;


                //Creating role tree nodes 
                TreeNode treeNodeSysAdminRole = new TreeNode(NirvanaRoles.SystemAdministrator.ToString());
                NodeDetails sysAdminRolNode = new NodeDetails(NodeType.Roles, (int)NirvanaRoles.SystemAdministrator, (int)NirvanaRoles.SystemAdministrator);
                treeNodeSysAdminRole.Tag = sysAdminRolNode;

                TreeNode treeNodeAdminRole = new TreeNode(NirvanaRoles.Administrator.ToString());
                NodeDetails adminRoleNode = new NodeDetails(NodeType.Roles, (int)NirvanaRoles.Administrator, (int)NirvanaRoles.Administrator);
                treeNodeAdminRole.Tag = adminRoleNode;

                TreeNode treeNodePowerUserRole = new TreeNode(NirvanaRoles.PowerUser.ToString());
                NodeDetails powerUserRoleNode = new NodeDetails(NodeType.Roles, (int)NirvanaRoles.PowerUser, (int)NirvanaRoles.PowerUser);
                treeNodePowerUserRole.Tag = powerUserRoleNode;

                TreeNode treeNodeUserRole = new TreeNode(NirvanaRoles.User.ToString());
                NodeDetails roleNode = new NodeDetails(NodeType.Roles, (int)NirvanaRoles.User, (int)NirvanaRoles.User);
                treeNodeUserRole.Tag = roleNode;

                //current logged in User Role
                NirvanaRoles currentUserRole = AuthorizationManager.GetInstance()._authorizedPrincipal.Role;

                //Adding role node based on permission heirarchy
                if (currentUserRole >= NirvanaRoles.SystemAdministrator)
                    treeNodeUsers.Nodes.Add(treeNodeSysAdminRole);
                if (currentUserRole > NirvanaRoles.Administrator)
                    treeNodeUsers.Nodes.Add(treeNodeAdminRole);
                if (currentUserRole > NirvanaRoles.PowerUser)
                    treeNodeUsers.Nodes.Add(treeNodePowerUserRole);
                if (currentUserRole > NirvanaRoles.User)
                    treeNodeUsers.Nodes.Add(treeNodeUserRole);

                //}

                // --------------------------------------------------------------------------

                //Create copmpany user nodes.
                // --------------------------------------------------------------------------


                //GetUsers method is used to fetch the existing users in the database to a given company.
                Users users = UserManager.GetAllUsers();
                foreach (Prana.Admin.BLL.User user in users)
                {
                    TreeNode treeNodeUser = new TreeNode(user.ShortName);
                    NodeDetails userNode = new NodeDetails(NodeType.Users, user.UserID, user.RoleID);
                    treeNodeUser.Tag = userNode;

                    NirvanaRoles roleOfUser = (NirvanaRoles)user.RoleID;

                    switch (roleOfUser)
                    {
                        case NirvanaRoles.SystemAdministrator:
                            if (treeNodeSysAdminRole != null)
                                treeNodeSysAdminRole.Nodes.Add(treeNodeUser);
                            break;
                        case NirvanaRoles.Administrator:
                            treeNodeAdminRole.Nodes.Add(treeNodeUser);
                            break;
                        case NirvanaRoles.PowerUser:
                            treeNodePowerUserRole.Nodes.Add(treeNodeUser);
                            break;
                        case NirvanaRoles.User:
                            treeNodeUserRole.Nodes.Add(treeNodeUser);
                            break;

                    }


                }

                trvUsers.Nodes.Add(treeNodeUsers);
                // --------------------------------------------------------------------------

                trvUsers.ExpandAll();

            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
        }

