        /// <summary>
        /// This method initializes a company controls by binding combo boxes, getting all the existing 
        /// underlyings, assets, modules, thirdparties, counterparties, counterpartyvenues. 
        /// </summary>
        private void InitializeSetUpCompany()
        {
            InitializeCompliance();
            BindCompanyType();

            try
            {
                //Bind AUEC
                Prana.Admin.BLL.AUECs auecs = AUECManager.GetAUEC();

                System.Data.DataTable dtauec = new System.Data.DataTable();
                dtauec.Columns.Add("Data");
                dtauec.Columns.Add("Value");
                object[] rowAUEC = new object[2];
                if (auecs.Count > 0)
                {
                    foreach (Prana.Admin.BLL.AUEC auec in auecs)
                    {
                        string Data = auec.AUECString;
                        int Value = auec.AUECID;

                        rowAUEC[0] = Data;
                        rowAUEC[1] = Value;
                        dtauec.Rows.Add(rowAUEC);
                    }
                    checkedlstAssetsUnderlyings.DataSource = dtauec;
                    checkedlstAssetsUnderlyings.DisplayMember = "Data";
                    checkedlstAssetsUnderlyings.ValueMember = "Value";
                }

                //Bind Module list
                Modules modules = ModuleManager.GetModules();
                if (modules.Count > 0)
                {
                    checkedlstApplicationComponents.DataSource = modules;
                    checkedlstApplicationComponents.DisplayMember = "ModuleName";
                    checkedlstApplicationComponents.ValueMember = "ModuleID";
                }

                //Bind Thirdparty
                List<ThirdPartyType> thirdPartyTypes = ThirdPartyDataManager.GetThirdPartyTypes();
                ThirdParties thirdParties = ThirdPartyDataManager.GetThirdParties();
                var thirdPartyTypesWiseThirdParties = CreateThirdPartyTypesWiseThirdParties(thirdParties, thirdPartyTypes);

                System.Data.DataTable tempDataTableThirdParty = new System.Data.DataTable();
                tempDataTableThirdParty.Columns.Add("DisplayData");
                tempDataTableThirdParty.Columns.Add("ThirdPartyTypeID");
                tempDataTableThirdParty.Columns.Add("ThirdPartyID");

                foreach (Prana.BusinessObjects.ThirdPartyType thirdPartyType in thirdPartyTypes)
                {
                    if (thirdPartyType.ThirdPartyTypeID == (int)ApplicationConstants.ThirdPartyNodeType.PrimeBrokerClearer)
                    {
                        //System.Data.DataRow row = tempDataTableThirdParty.NewRow();
                        //row = tempDataTableThirdParty.NewRow();

                        //row["DisplayData"] = thirdPartyType.ThirdPartyTypeName;
                        //row["ThirdPartyTypeID"] = thirdPartyType.ThirdPartyTypeID;
                        //row["ThirdPartyID"] = int.MinValue;
                        //tempDataTableThirdParty.Rows.Add(row);

                        foreach (ThirdParty thirdParty in thirdPartyTypesWiseThirdParties[thirdPartyType.ThirdPartyTypeID])
                        {
                            System.Data.DataRow rowTPPB = tempDataTableThirdParty.NewRow();
                            rowTPPB["DisplayData"] = thirdParty.ThirdPartyName;
                            rowTPPB["ThirdPartyTypeID"] = thirdParty.ThirdPartyTypeID;
                            rowTPPB["ThirdPartyID"] = thirdParty.ThirdPartyID;
                            tempDataTableThirdParty.Rows.Add(rowTPPB);
                        }
                    }
                }

                if (thirdParties.Count > 0)
                {
                    checkedlstThirdPartyComponents.DataSource = tempDataTableThirdParty;
                    checkedlstThirdPartyComponents.DisplayMember = "DisplayData";
                    checkedlstThirdPartyComponents.ValueMember = "ThirdPartyID";
                }

                // Bind ThirdParty Vendors
                ThirdParties thirdPartiesVendor = new ThirdParties();
                foreach (ThirdParty thirdParty in thirdParties)
                {
                    if (thirdParty.ThirdPartyTypeID == (int)ApplicationConstants.ThirdPartyNodeType.Vendor)
                    {
                        thirdPartiesVendor.Add(thirdParty);
                    }
                }
                if (thirdPartiesVendor.Count > 0)
                {
                    chkLstVendor.DataSource = thirdPartiesVendor;
                    chkLstVendor.DisplayMember = "ThirdPartyName";
                    chkLstVendor.ValueMember = "ThirdPartyID";
                }

                //Bind EMS Sources
                ImportTradeXSLTFileCollection emsSources = new ImportTradeXSLTFileCollection();
                emsSources = DataManager.GetAllEMSSources();
                if (emsSources.Count > 0)
                {
                    chkLstEMSSource.DataSource = emsSources;
                    chkLstEMSSource.DisplayMember = "ImportSourceID";
                    chkLstEMSSource.ValueMember = "EMSSource";
                }

                //Bind Counterparties
                CounterParties counterParties = CounterPartyManager.GetCounterParties();
                System.Data.DataTable tempDataTable = new System.Data.DataTable();
                tempDataTable.Columns.Add("DisplayData");
                tempDataTable.Columns.Add("CounterPartyID");
                tempDataTable.Columns.Add("VenueID");
                foreach (Prana.Admin.BLL.CounterParty counterParty in counterParties)
                {
                    if (counterParty.Venues.Count > 0)
                    {
                        System.Data.DataRow row = tempDataTable.NewRow();
                        row["DisplayData"] = counterParty.CounterPartyFullName;
                        row["CounterPartyID"] = counterParty.CounterPartyID;
                        row["VenueID"] = int.MinValue;
                        tempDataTable.Rows.Add(row);
                        foreach (Prana.Admin.BLL.Venue venue in counterParty.Venues)
                        {
                            row = tempDataTable.NewRow();
                            row["DisplayData"] = "      " + venue.VenueName;
                            row["CounterPartyID"] = counterParty.CounterPartyID;
                            row["VenueID"] = venue.VenueID;
                            tempDataTable.Rows.Add(row);
                        }
                    }
                }

                if (counterParties.Count > 0)
                {
                    checkedlstCounterParties.DataSource = null;
                    checkedlstCounterParties.Items.Clear();
                    checkedlstCounterParties.DataSource = tempDataTable;
                    checkedlstCounterParties.DisplayMember = "DisplayData";
                    checkedlstCounterParties.ValueMember = "CounterPartyID";
                }

                grpPM.Enabled = false;
                BindOrderTypes();
                BindTimeInForce();
                BindHandlingInstructions();
                BindExecutionInstructions();
                BindMasterUsers();
            }
            catch (Exception)
            {
            }
        }

        /// <summary>
        /// This method is to create third party type wise Third Parties
        /// </summary>
        /// <param name="thirdParties"></param>
        /// <param name="thirdPartyTpes"></param>
        /// <returns></returns>
        private Dictionary<int, List<ThirdParty>> CreateThirdPartyTypesWiseThirdParties(ThirdParties thirdParties, List<ThirdPartyType> thirdPartyTpes)
        {
            Dictionary<int, List<ThirdParty>> result = new Dictionary<int, List<ThirdParty>>();
            try
            {
                foreach (var thirdPartyType in thirdPartyTpes)
                {
                    if (!result.ContainsKey(thirdPartyType.ThirdPartyTypeID))
                    {
                        result.Add(thirdPartyType.ThirdPartyTypeID, new List<ThirdParty>());
                    }
                }
                foreach (ThirdParty thirdParty in thirdParties)
                {
                    if (result.ContainsKey(thirdParty.ThirdPartyTypeID))
                        result[thirdParty.ThirdPartyTypeID].Add(thirdParty);
                }
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDTHROW);

                if (rethrow)
                {
                    throw;
                }
            }
            return result;
        }

