                    else if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpUserDetails"])
                    {
                        NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                        switch (nodeDetails.Type)
                        {
