        /// <summary>
        /// This method deletes the selected node when clicking the delete button in the form. 
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnDelete_Click(object sender, System.EventArgs e)
        {
            try
            {
                if (tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYUSER])
                {
                    if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpUserSetup"])
                    {
                        if (trvUsers.SelectedNode.Parent != null)
                        {
                            if (trvUsers.SelectedNode == null)
                            {
                                //Nothing is selected in Node tree.
                                MessageBox.Show("Please select User for deletion!");
                            }
                            else
                            {
                                //Getting the info about the previous node so as to select it after deleting the 
                                //currently selected node.
                                //NodeDetails prevNodeDetails = new NodeDetails();
                                //if (trvUsers.SelectedNode.PrevNode != null)
                                //{
                                //    prevNodeDetails = (NodeDetails)trvUsers.SelectedNode.PrevNode.Tag;
                                //}
                                //else
                                //{
                                //    prevNodeDetails = (NodeDetails)trvUsers.SelectedNode.Parent.Tag;
                                //}

                                //Getting the info about the currently selected node to be deleted.
                                NodeDetails nodeDetails = (NodeDetails)trvUsers.SelectedNode.Tag;
                                switch (nodeDetails.Type)
                                {
                                    case NodeType.Users:
                                        int userID = Convert.ToInt32(nodeDetails.NodeID);
                                        if (userID == int.MinValue)
                                        {
                                            MessageBox.Show("Please select User for deletion!");
                                        }
                                        else
                                        {
                                            if (DeleteUser(userID))
                                            {
                                                //Binding the tree after deleting the selected node
                                                BindUsersTree();
                                                //DataTable dtCompaniesList = CachedDataManager.GetInstance.GetCompany();
                                                userSetup1.InitializeControl(_LoginUserID, (int)_LoginUserRole);
                                                userSetup1.AuditUserDeletion(userID);
                                                //SelectTreeNode(prevNodeDetails);
                                            }
                                        }
                                        break;
                                }
                            }
                        }
                    }
                    if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpAccountGroupSetup"])
                    {
                        if (trvAccountGroups.SelectedNode == null)
                        {
                            //Nothing is selecte in Node tree.
                            MessageBox.Show("Please select Group for deletion!");
                        }
                        else
                        {
                            //Getting the info about the currently selected node to be deleted.
                            NodeDetails nodeDetails = (NodeDetails)trvAccountGroups.SelectedNode.Tag;
                            switch (nodeDetails.Type)
                            {
                                case NodeType.Groups:
                                    int groupID = Convert.ToInt32(nodeDetails.NodeID);
                                    if (groupID == int.MinValue)
                                    {
                                        MessageBox.Show("Please select Group for deletion!");
                                    }
                                    else
                                    {
                                        if (MessageBox.Show(this, "Do you want to delete selected Group?", "Alert", MessageBoxButtons.YesNo) == DialogResult.Yes)
                                        {
                                            bool chkVarraible = UserManager.DeleteSelectedGroup(groupID);
                                            if (!(chkVarraible))
                                            {
                                                //User not deleted.	
                                                MessageBox.Show(this, "The selected group is assigned to some User. Please remove the association to delete the group", "Alert", MessageBoxButtons.OK);
                                            }
                                            else
                                            {
                                                //Binding the tree after deleting the selected node
                                                BindAccountGroupTree();
                                                accountGroupSetup1.InitializeControl(int.MinValue, String.Empty);
                                                accountGroupSetup1.AuditAccountGroupDeletion(groupID);
                                            }
                                        }
                                    }
                                    break;
                            }
                        }
                    }
                    if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpUserDetails"])
                    {
                        if (trvCompanyMaster.SelectedNode == null)
                        {
                            //Nothing is selected in Node tree.
                            MessageBox.Show("Please select user for deletion!");
                        }
                        else
                        {
                            //Getting the info about the previous node so as to select it after deleting the 
                            //currently selected node.
                            NodeDetails prevNodeDetails = new NodeDetails();
                            if (trvCompanyMaster.SelectedNode.PrevNode != null)
                            {
                                prevNodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.PrevNode.Tag;
                            }
                            else
                            {
                                prevNodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Parent.Tag;
                            }

                            //Getting the info about the currently selected node to be deleted.
                            NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                            switch (nodeDetails.Type)
                            {
                                case NodeType.Users:
                                    int userID = nodeDetails.NodeID;
                                    if (DeleteUser(userID))
                                    {
                                        //Binding the tree after deleting the selected node and selecting its
                                        //previous node.
                                        BindTree();
                                        SelectTreeNode(prevNodeDetails);
                                    }
                                    break;
                            }
                        }
                    }
                }
                else
                {
                    if (trvCompanyMaster.SelectedNode.Parent != null)
                    {
                        if (trvCompanyMaster.SelectedNode == null)
                        {
                            //Nothing is selected in Node tree.
                            MessageBox.Show("Please select Client/User/Counter Party/!");
                        }
                        else
                        {

                            //Getting the info about the previous node so as to select it after deleting the 
                            //currently selected node.
                            NodeDetails prevNodeDetails = new NodeDetails();
                            if (trvCompanyMaster.SelectedNode.PrevNode != null)
                            {
                                prevNodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.PrevNode.Tag;
                            }
                            else
                            {
                                prevNodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Parent.Tag;
                            }

                            //Getting the info about the currently selected node to be deleted.
                            NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                            switch (nodeDetails.Type)
                            {
                                case NodeType.Company:
                                    int companyID = nodeDetails.NodeID;
                                    if (MessageBox.Show(this, "Do you want to delete selected Client?", "Alert", MessageBoxButtons.YesNo) == DialogResult.Yes)
                                    {
                                        //Deleting the selected company before checking it for reference in other 
                                        //nodes or forms.
                                        // Modified at JIRA : CHMW-596
                                        string returnedValue = string.Empty;
                                        bool chkVarraible = false;

                                        chkVarraible = CompanyManager.DeleteCompany(companyID, true);
                                        if (!(chkVarraible))
                                        {
                                            MessageBox.Show(this, "Client is referenced in PM Module or RM Modules.\n Please remove references to delete it", "Alert");
                                        }
                                        else
                                        {
                                            //Binding the tree after deleting the selected node and selecting its
                                            //previous node.
                                            BindTree();
                                            SelectTreeNode(prevNodeDetails);
                                        }
                                    }
                                    break;
                                case NodeType.Clients:
                                    int clientID = nodeDetails.NodeID;
                                    if (MessageBox.Show(this, "Do you want to delete selected Client?", "Alert", MessageBoxButtons.YesNo) == DialogResult.Yes)
                                    {
                                        //Deleting the selected Client before checking it for reference in other 
                                        //nodes or forms.
                                        bool chkVarraible = CompanyManager.DeleteCompanyClient(nodeDetails.CompanyID, clientID, true);
                                        if (!(chkVarraible))
                                        {
                                            MessageBox.Show(this, "The selected user is referred further. Please remove references to delete the user", "Alert", MessageBoxButtons.OK);
                                        }
                                        else
                                        {
                                            //Binding the tree after deleting the selected node and selecting its
                                            //previous node.
                                            BindTree();
                                            SelectTreeNode(prevNodeDetails);
                                        }
                                    }
                                    break;

                                case NodeType.CounterPartyVenues:
                                    int companyCounterPartyVenueID = nodeDetails.NodeID;
                                    //if(MessageBox.Show(this, "Do you want to delete selected CounterParty?", "Alert", MessageBoxButtons.YesNo) == DialogResult.Yes)
                                    //{
                                    ////Delete CounterParties with its details.																
                                    //if(companyCounterPartyVenueID != int.MinValue)
                                    //{
                                    //    CompanyManager.DeleteCompanyCounterPartyVenueDetail(companyCounterPartyVenueID);
                                    //    //Binding the tree after deleting the selected node and selecting its
                                    //    //previous node.
                                    //    BindTree();
                                    //    SelectTreeNode(prevNodeDetails);
                                    //}

                                    //}
                                    MessageBox.Show(this, "You can not delete the Broker Venue from there but from the company permissions !", "Alert", MessageBoxButtons.OK);
                                    break;

                                case NodeType.Users:
                                    int userID = nodeDetails.NodeID;
                                    if (DeleteUser(userID))
                                    {
                                        //Binding the tree after deleting the selected node and selecting its
                                        //previous node.
                                        BindTree();
                                        SelectTreeNode(prevNodeDetails);
                                    }
                                    break;
                            }

                        }
                    }
                }
            }

            #region Catch
            catch (Exception ex)
            {
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);

                if (rethrow)
                {
                    throw;
                }
            }
            #endregion
            finally
            {
                #region LogEntry

                //Logger.LoggerWrite("btnDelete_Click", 
                //    LoggingConstants.LOG_CATEGORY_UI, 1, 1, System.Diagnostics.TraceEventType.Information,
                //    FORM_NAME + "btnDelete_Click", null);  
                // 

                #endregion
            }
        }

        /// <summary>
        /// Delete Window User
        /// </summary>
        /// <param name="login"></param>
        private bool DeleteUser(int userID)
        {
            bool success = false;
            try
            {
                using (var txscope = new TransactionScope())
                {
                    if (MessageBox.Show(this, "Do you want to delete selected User?", "Alert", MessageBoxButtons.YesNo) == DialogResult.Yes)
                    {
                        string login = UserManager.DeleteCompanyUser(userID, _isPermanentDeletion);
                        if (string.IsNullOrEmpty(login))
                        {
                            //User not deleted.	
                            MessageBox.Show(this, "The selected user is referred further. Please remove references to delete the user", "Alert", MessageBoxButtons.OK);
                        }
                        else
                        {
                            if (_isWindowUserReq)
                            {
                                DirectoryEntry localDirectory = new DirectoryEntry("WinNT://" + Environment.MachineName);
                                DirectoryEntries users = localDirectory.Children;
                                // check Windows user exists or not
                                if (DirectoryEntry.Exists("WinNT://" + Environment.MachineName + "/" + login))
                                {
                                    DirectoryEntry user = users.Find(login);
                                    users.Remove(user);
                                }
                            }

                            txscope.Complete();
                            success = true;
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                success = false;
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
            return success;
        }

