        {
            tbcCompanyCounterParties.Enabled = true;
            tbcCompanyMaster.Enabled = true;
            tbcCompanyUser.Enabled = true;
            tbcCompanyClients.Enabled = true;
            tbcCompanyThirdParty.Enabled = true;
        }

