        /// <summary>
        /// This method saves the company user form related information on its click event in the form. This
        /// includes user's basic details and the permissions.
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnSaveCompanyUser_Click(object sender, System.EventArgs e)
        {
            try
            {
                int countSave = 0;
                if (ctrlUserPermissions1._isSaveRequired)
                {
                    countSave = ctrlUserPermissions1.SavePermissions();
                    if (countSave > 0)
                    {
                        MessageBox.Show("Permission details saved", "Success", MessageBoxButtons.OK, MessageBoxIcon.Information);
                        AuthorizationManager.GetInstance().RefreshUserPermissions();
                    }
                }
                // Added by:sachin mishra 21/jan/2015 JIRA-No CHMW-2335 for showing the message when permission mapping tab selected and click the save button
                else
                {
                    if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpUserPermission"])
                    {
                        MessageBox.Show("Nothing to Save !", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Warning);
                    }

                }
                NodeDetails nodeDetails = new NodeDetails();
                //Added By : Manvendra P.
                //Jira : http://jira.nirvanasolutions.com:8080/browse/PRANA-7647
                if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpAccountGroupSetup"])
                {
                    if (trvAccountGroups.SelectedNode != null)
                    {
                        nodeDetails = (NodeDetails)trvAccountGroups.SelectedNode.Tag;
                    }
                    int result = accountGroupSetup1.uBtnSaveAccountGroupSetup_Click();
                    if (result > 0)
                    {
                        BindAccountGroupTree();
                        SelectGroupTreeNode(nodeDetails);
                        MessageBox.Show("Account Group Saved", "Success", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                }

                if (tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpUserDetails"] || tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpPermission"]
                    || tbcCompanyUser.SelectedTab == tbcCompanyUser.Tabs["tbpCompliancePermission"])
                {
                    int selUserID = int.MinValue;
                    if (trvCompanyMaster.SelectedNode != null)
                    {
                        nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;

                        //Save User details.
                        //-----------------------------------------------------------------------------
                        //					uctCompanyUserDetail.ParentStatusBar = stbCompany;
                        Prana.Admin.BLL.User user = uctCompanyUserDetail.User;
                        if (user != null)
                        {
                            user.UserID = nodeDetails.NodeID;
                            bool isNewUser = user.UserID == int.MinValue;
                            int companyid = nodeDetails.CompanyID;
                            user.CompanyID = companyid;
                            string oldUserName = user.LoginName;
                            bool transactionSuccessful = false;
                            int userID = int.MinValue;
                            using (var txscope = new TransactionScope())
                            {
                                userID = UserManager.SaveCompanyUser(companyid, user, ref oldUserName);
                                if (userID < 0)
                                {
                                    MessageBox.Show("User with the same short name already exists.", "Alert", MessageBoxButtons.OK);
                                }
                                else
                                {
                                    if (_isWindowUserReq)
                                    {
                                        string errorMsg = AddUpdateWindowsUser(oldUserName, user.LoginName, user.Password, isNewUser);
                                        if (!string.IsNullOrEmpty(errorMsg))
                                        {
                                            MessageBox.Show("Error while adding/updating user:\n" + errorMsg, "Alert", MessageBoxButtons.OK);
                                        }
                                        else
                                        {
                                            txscope.Complete();
                                            transactionSuccessful = true;
                                        }
                                    }
                                    else
                                    {
                                        txscope.Complete();
                                        transactionSuccessful = true;
                                    }
                                }
                            }
                            if (transactionSuccessful)
                            {
                                //Save Company User permissions
                                uctCompanyUserPermissions.Save(userID, nodeDetails.CompanyID);
                                uctComplianceUserPermissions.SaveCompliancePermissions(userID, nodeDetails.CompanyID);

                                selUserID = userID;
                                BindTree();
                                int selCompanyID = int.Parse(nodeDetails.CompanyID.ToString());
                                NodeDetails selectNodeDetails = new NodeDetails(NodeType.Users, selUserID, selCompanyID);
                                SelectTreeNode(selectNodeDetails);

                                //TODO: Needs to correct the position of audit
                                //incorrect position to call audit
                                //because encapsulation was missing on company user object in control
                                //userid and companyid is assigned outside of controls and partial data is coming out of the control
                                AuditManager.BLL.AuditHandler.GetInstance().AuditDataForGivenInstance(uctCompanyUserDetail, user, AuditManager.Definitions.Enum.AuditAction.UserUpdated);
                                uctCompanyUserDetail.SetupControl(user.CompanyID, user.UserID);
                                //Added by Faisal Shah on 06/25/2014
                                //Commented by Suraj, Aug 7 2014, to keep the same active tab after save

                                MessageBox.Show("User details saved", "Success", MessageBoxButtons.OK, MessageBoxIcon.Information);
                            }
                        }
                        else
                        {
                            MessageBox.Show("Please select a user to edit the details ", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Information);
                            // tbcCompanyUser.SelectedTab = tbcCompanyUser.Tabs["tbpUserDetails"];
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
            finally
            {
                #region LogEntry

                //Logger.LoggerWrite("btnSaveCompanyUser_Click", 
                //    LoggingConstants.LOG_CATEGORY_UI, 1, 1, System.Diagnostics.TraceEventType.Information,
                //    FORM_NAME + "btnSaveCompanyUser_Click", null);  
                // 

                #endregion
            }
        }

        /// <summary>
        /// Add or Update Window User based on updates in Prana User
        /// </summary>
        /// <param name="oldUserName"></param>
        /// <param name="name"></param>
        /// <param name="pass"></param>
        /// <param name="isNewUser"></param>
        /// <returns></returns>
        private static string AddUpdateWindowsUser(string oldUserName, string name, string pass, bool isNewUser)
        {
            String errorMessage = string.Empty;
            try
            {
                DirectoryEntry localDirectory = new DirectoryEntry("WinNT://" + Environment.MachineName + ",computer");
                if (isNewUser)
                {
                    DirectoryEntry user = localDirectory.Children.Add(name, "user");
                    user.Invoke("SetPassword", new object[] { pass });
                    user.Invoke("Put", new object[] { "Description", "Prana User" });
                    user.CommitChanges();
                    int NON_EXPIRE_FLAG = 0x10000;
                    int val = (int)user.Properties["UserFlags"].Value;
                    user.Properties["UserFlags"].Value = val | NON_EXPIRE_FLAG;
                    user.CommitChanges();
                    DirectoryEntry grp = localDirectory.Children.Find("Administrators", "group");
                    if (grp != null)
                    {
                        grp.Invoke("Add", new object[] { user.Path.ToString() });
                    }
                    DirectoryEntry pranaGrp = localDirectory.Children.Find("Prana", "group");
                    if (pranaGrp != null)
                    {
                        pranaGrp.Invoke("Add", new object[] { user.Path.ToString() });
                    }
                }
                else
                {
                    // check Windows user exists or not
                    if (DirectoryEntry.Exists("WinNT://" + Environment.MachineName + "/" + oldUserName))
                    {
                        DirectoryEntries users = localDirectory.Children;
                        DirectoryEntry user = users.Find(oldUserName);
                        if (!pass.Equals(ApplicationConstants.DUMMY_PASSWORD))
                            user.Invoke("SetPassword", new object[] { pass });
                        if (!oldUserName.Equals(name))
                        {
                            user.Rename(name);
                        }
                        user.CommitChanges();
                    }
                    else
                    {
                        MessageBox.Show("Window user doesn't exist, please add manually.", "Alert", MessageBoxButtons.OK);
                    }

                }
            }
            catch (Exception ex)
            {
                if (ex.Message.StartsWith("The group name could not be found."))
                    errorMessage = ErrorStatements.ENCRYPTION_ERROR;
                else if (ex.InnerException == null || string.IsNullOrEmpty(ex.InnerException.Message))
                    errorMessage = ex.Message;
                else
                    errorMessage = ex.InnerException.Message;
            }
            return errorMessage;
        }

        /// <summary>
        /// JIRA : CHMW-364
        /// This method selects the node in trvUsers based on the parameter passed to it in nodedetails. 
        /// Currently using nodeDetails class and saving RoleID in companyID
        /// </summary>
        /// <param name="nodeDetails"></param>
        private void SelectUsersTreeNode(NodeDetails nodeDetails)
        {
            int compIndex = -1;
            switch (nodeDetails.Type)
            {
                case NodeType.Users:
                    foreach (TreeNode node in trvUsers.Nodes[C_TAB_COMPANYSETUP].Nodes)
                    {
                        compIndex++;
                        if (trvUsers.Nodes[C_TAB_COMPANYSETUP].Nodes[compIndex].Nodes.Count > 0)
                        {
                            foreach (TreeNode userNode in trvUsers.Nodes[C_TAB_COMPANYSETUP].Nodes[compIndex].Nodes)
                            {
                                if (((NodeDetails)userNode.Tag).NodeID == nodeDetails.NodeID)
                                {
                                    trvUsers.SelectedNode = userNode;
                                    break;
                                }
                            }
                        }
                    }
                    break;
                case NodeType.Roles:
                    if (nodeDetails.CompanyID == int.MinValue)
                        nodeDetails.CompanyID = (int)NirvanaRoles.User;
                    foreach (TreeNode node in trvUsers.Nodes[C_TAB_COMPANYSETUP].Nodes)
                    {
                        compIndex++;
                        if (((NodeDetails)node.Tag).NodeID == nodeDetails.CompanyID)
                        {
                            trvUsers.SelectedNode = node;
                        }
                    }
                    break;
                default:
                    trvUsers.SelectedNode = trvUsers.Nodes[0];
                    break;
            }
        }

        /// <summary>
        /// JIRA : CHMW-364
        /// This method selects the node in trvAccountGroups based on the parameter passed to it in nodedetails. 
        /// </summary>
        /// <param name="nodeDetails"></param>
        private void SelectGroupTreeNode(NodeDetails nodeDetails)
        {
            int compIndex = -1;
            switch (nodeDetails.Type)
            {
                case NodeType.Groups:
                    if (nodeDetails.CompanyID == int.MinValue)
                        trvAccountGroups.SelectedNode = trvAccountGroups.Nodes[0];
                    else
                    {
                        foreach (TreeNode node in trvAccountGroups.Nodes[C_TAB_COMPANYSETUP].Nodes)
                        {
                            compIndex++;
                            if (((NodeDetails)node.Tag).NodeID == nodeDetails.CompanyID)
                            {
                                trvAccountGroups.SelectedNode = node;
                                break;
                            }
                        }
                    }
                    break;
                default:
                    trvAccountGroups.SelectedNode = trvAccountGroups.Nodes[0];
                    break;
            }
        }

