            }
            if (thirdParties.Count > 0)
            {
                foreach (Prana.BusinessObjects.ThirdParty thirdPartyVendor in thirdParties)
                {
                    for (int j = 0; j < chkLstVendor.Items.Count; j++)
                    {
                        if (((Prana.BusinessObjects.ThirdParty)chkLstVendor.Items[j]).ThirdPartyID == thirdPartyVendor.ThirdPartyID)
                        {
                            chkLstVendor.SetItemChecked(j, true);
                        }
                    }
                }
            }
            else
            {
                for (int j = 0; j < chkLstVendor.Items.Count; j++)
                {
                    chkLstVendor.SetItemChecked(j, false);
                }
            }

            checkedlstAssetsUnderlyings.SelectedIndex = -1;
            checkedlstAssetsUnderlyings.ClearSelected();
            foreach (Prana.Admin.BLL.AUEC companyAUEC in companyAUECs)
            {
                checkedlstAssetsUnderlyings.SelectedValue = companyAUEC.AUECID;
