        #region NodeDetails

        //Creating class NodeDetail to be used for the purpose of tree giving it some methods & properties.
        class NodeDetails
        {
            private NodeType _type = NodeType.Company;
            private int _nodeID = int.MinValue;
            private int _companyID = int.MinValue;
            private int _parentID = int.MinValue;

            public NodeDetails()
            {
            }

            public NodeDetails(NodeType type, int nodeID)
            {
                _type = type;
                _nodeID = nodeID;
            }

            public NodeDetails(NodeType type, int nodeID, int companyID)
            {
                _type = type;
                _nodeID = nodeID;
                _companyID = companyID;
            }

            //parentID used for one off case specifically to recognize the counterparty node in the tree.
            public NodeDetails(NodeType type, int nodeID, int companyID, int parentID)
            {
                _type = type;
                _nodeID = nodeID;
                _companyID = companyID;
                _parentID = parentID;
            }

            public NodeType Type
            {
                get { return _type; }
                set { _type = value; }
            }
            public int NodeID
            {
                get { return _nodeID; }
                set { _nodeID = value; }
            }
            public int CompanyID
            {
                get { return _companyID; }
                set { _companyID = value; }
            }
            public int ParentID
            {
                get { return _parentID; }
                set { _parentID = value; }
            }
        }

        //Creating enumeration to be used to distinguish tree nodetype on the basis of Company/Users/CounterParties/Clients
        enum NodeType
        {
            Company = 1,
            Users = 2,
            CounterParties = 3,
            Clients = 4,
            CounterPartyVenues = 5,
            ThirdParty = 6,
            RoutingLogic = 7,
            CommissionRule = 8,
            Roles = 9,
            Groups = 10
        }

