        /// <summary>
        /// Saves the Company Counter Parties having the tags ie. company level, account level & user level. It
        /// saves the all the info taken together from the tags at a time.
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnCompanyCouterPartiesSave_Click(object sender, System.EventArgs e)
        {
            try
            {
                Prana.Admin.BLL.CounterPartyVenue counterPartyVenue = new Prana.Admin.BLL.CounterPartyVenue();

                int resultCompanyLevelTag = int.MinValue;
                //int selCompanyLevelTag = int.MinValue;
                NodeDetails selNodeDetails = new NodeDetails();

                int selCounterPartyVenueDetails = int.MinValue;
                NodeDetails counterNodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                selCounterPartyVenueDetails = counterNodeDetails.NodeID;

                // counterparty object declared for audit trail
                counterPartyVenue.CounterPartyVenueID = counterNodeDetails.NodeID;
                counterPartyVenue.CompanyCounterPartyCVID = counterNodeDetails.CompanyID;

                NodeDetails parentCounterNodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Parent.Tag;
                int counterPartyID = parentCounterNodeDetails.NodeID;

                if (trvCompanyMaster.SelectedNode != null)
                {
                    NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;

                    //Saving the company level tag info to the database by getting the data from the user control's 
                    //CurrentCompanyCounterPartyVenueDetails property.
                    //					Prana.Admin.BLL.CompanyCounterPartyVenueDetails companyCounterPartyVenueDetailsCompany = uctGridCompanyCountePartiesCompanyLevelTags.CurrentCompanyCounterPartyVenueDetails;
                    //					if(uctGridCompanyCountePartiesCompanyLevelTags.CurrentCompanyCounterPartyVenueDetails != null)
                    //					{
                    //						resultCompanyLevelTag = CompanyManager.SaveCompanyCounterPartyCompanyLevelTags(companyCounterPartyVenueDetailsCompany);
                    //						int resultCompanyCVIdentifier = CompanyManager.SaveCompanyCounterPartyVenueIdentifier(companyCounterPartyVenueDetailsCompany);
                    //						selCompanyLevelTag = resultCompanyLevelTag;
                    //					}

                    Prana.Admin.BLL.CompanyCounterPartyVenueDetail companyCounterPartyVenueDetail = uctGridCompanyCountePartiesCompanyLevelTags.CompanyCounterPartyVenueDetailSave;
                    Prana.Admin.BLL.CompanyCVGiveUpIdentifiers companyCVGiveUpIdentifiers = uctGridCompanyCountePartiesCompanyLevelTags.CompanyCVGiveUpIdentifiersSave;
                    if (companyCVGiveUpIdentifiers == null)
                    {
                        return;
                    }
                    Prana.Admin.BLL.CompanyCVCMTAIdentifiers companyCVCMTAIdentifiers = uctGridCompanyCountePartiesCompanyLevelTags.CompanyCVCMTAIdentifiersSave;
                    if (companyCVCMTAIdentifiers == null)
                    {
                        return;
                    }
                    if (companyCounterPartyVenueDetail != null)
                    {
                        AuditManager.BLL.AuditHandler.GetInstance().AuditDataForGivenInstance(uctGridCompanyCountePartiesCompanyLevelTags, counterPartyVenue, AuditManager.Definitions.Enum.AuditAction.CounterPartyVenueUpdated);
                        resultCompanyLevelTag = CompanyManager.SaveCompanyCounterPartyCompanyLevelTagAdHoc(companyCounterPartyVenueDetail);
                        //int resultCompanyCVIdentifier = CompanyManager.SaveCompanyCounterPartyVenueIdentifierAdHoc(companyCounterPartyVenueDetail);

                        // Save GiveUp Identifier                 
                        if (companyCVGiveUpIdentifiers.Count > 0)
                        {
                            int resultCompanyCVGiveUpIdentifier = CompanyManager.SaveCompanyCVenueGiveUpIdentifiers(companyCVGiveUpIdentifiers, companyCounterPartyVenueDetail.CompanyCounterPartyVenueID);
                        }
                        else
                        {
                            CompanyManager.DeleteCompanyCVenueGiveUpIdentifiers(companyCounterPartyVenueDetail.CompanyCounterPartyVenueID);
                        }

                        // Save CMTA Identifier


                        if (companyCVCMTAIdentifiers.Count > 0)
                        {
                            int resultCompanyCVCMTAIdentifier = CompanyManager.SaveCompanyCVenueCMTAIdentifiers(companyCVCMTAIdentifiers, companyCounterPartyVenueDetail.CompanyCounterPartyVenueID);
                        }
                        else
                        {
                            CompanyManager.DeleteCompanyCVenueCMTAIdentifiers(companyCounterPartyVenueDetail.CompanyCounterPartyVenueID);
                        }

                        //selCompanyLevelTag = resultCompanyLevelTag;

                        BindTree();
                        int selCompanyID = int.Parse(nodeDetails.CompanyID.ToString());
                        //NodeDetails selectNodeDetails = new NodeDetails(NodeType.CounterParties, selCounterPartyVenueDetails, selCompanyID);
                        NodeDetails selectNodeDetails = new NodeDetails(NodeType.CounterParties, selCounterPartyVenueDetails, selCompanyID, counterPartyID);
                        //Selecting the newly added or updated node in the tree.
                        SelectTreeNode(selectNodeDetails);
                    }

                }


            }
            #region Catch
            catch (Exception ex)
            {
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);

                if (rethrow)
                {
                    throw;
                }
            }
            #endregion
            finally
            {
                #region LogEntry

                //Logger.LoggerWrite("btnCompanyCouterPartiesSave_Click", 
                //    LoggingConstants.LOG_CATEGORY_UI, 1, 1, System.Diagnostics.TraceEventType.Information,
                //    FORM_NAME + "btnCompanyCouterPartiesSave_Click", null);  
                // 

                #endregion
            }
        }

