        //TODO: To set only the list boxes on their respective tabs.
        private void tbcCompanySetup_SelectedTabChanged(object sender, Infragistics.Win.UltraWinTabControl.SelectedTabChangedEventArgs e)
        {
            SetUIOnCompanySetupTabChange();

            int companyID = -1;
            if (trvCompanyMaster.Nodes.Count > 0)
                companyID = ((NodeDetails)trvCompanyMaster.Nodes[0].Tag).NodeID;
            try
            {
                if (trvCompanyMaster.SelectedNode != null)
                {
                    NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;

                    if (nodeDetails == null)
                    {
                        MessageBox.Show("Select Some node!");
                        tbcCompanyMaster.Enabled = false;
                    }
                    else
                    {
                        companyID = nodeDetails.NodeID;

                        // For loading permission data for client
                        if (companyID > 0)
                        {
                            if (tbcCompanySetup.Tabs["tbpCompanyCompliance"].Selected == true)
                            {
                                uctCompanyCompliance.SetupControl(companyID);
                            }
                            else if (tbcCompanySetup.Tabs["tbcNavLock"].Selected == true)
                            {
                                accountSetup1.UpdateAccountBeforeTabChange();
                                AccountSetupManager.UpdateNAVLockSchedules();
                            }
                            else if (tbcCompanySetup.Tabs["tbcAccountSetup"].Selected == true)
                            {
                                accountSetup1.UpdateLockDateAfterAccountTabSelected();
                            }
                            else if (tbcCompanySetup.Tabs["tbpMasterFunds"].Selected == true)
                            {
                                bool isMasterFundManyToMany = CachedDataManager.GetInstance.IsMasterFundManyToManyMappingAllowed();
                                bool isShowMasterFundonTT = CachedDataManager.GetInstance.IsShowMasterFundonTT();
                                bool isShowmasterFundAsClient = CachedDataManager.GetInstance.IsShowmasterFundAsClient();
                                uctMasterFundMapping.InitializeControl(companyID, isMasterFundManyToMany, isShowmasterFundAsClient, isShowMasterFundonTT);
                            }
                            else if (tbcCompanySetup.SelectedTab.Key == "tbpCopyPreferences")
                            {
                                BindAllComboList();
                            }
                        }
                        //modified by:Bharat Raturi, Date: 02/14/2014
                        //Purpose: Prevent the index out of range exception when the tab is selected without making a selection of the company
                        else
                        {
                            return;
                        }

                    }
                }
            }
            catch (Exception)
            {
            }
            finally
            {
                #region LogEntry

                //Logger.LoggerWrite("trvCompanyMaster_AfterSelect", 
                //    LoggingConstants.LOG_CATEGORY_UI, 1, 1, System.Diagnostics.TraceEventType.Information,
                //    FORM_NAME + "trvCompanyMaster_AfterSelect", null); 
                // 

                #endregion
            }

        }

        private void SetUIOnCompanySetupTabChange()
        {
            try
            {
                btnApprove.Visible = false;
                btnSaveCompanySetup.Visible = true;
                btnClose.Visible = true;
                groupBox6.Visible = true;
                btnAdd.Visible = true;
                btnDelete.Visible = true;
                //btnClose.Location = new Point(361, 523);
                //btnSaveCompanySetup.Location = new Point(283, 523);
                //btnApprove.Location = new Point(361, 523);
                //added by: Bharat raturi, 24 apr 2014
                //purpose: hide the save button when the nav lock tab is selected
                if (tbcCompanySetup.Tabs["tbcNavLock"].Selected)
                {
                    btnSaveCompanySetup.Visible = false;
                    btnClose.Visible = false;
                    // Purpose : To hide treeview on navlock UI.
                    groupBox6.Visible = false;
                    btnAdd.Visible = false;
                    btnDelete.Visible = false;
                    //btnClose.Location = new Point(405, 428);
                    //return;
                }
                if (tbcCompanySetup.Tabs["tbpPricing"].Selected)
                {
                    //btnSaveCompanySetup.Location = new Point(320, 351);
                    //btnClose.Location = new Point(478, 351);
                    btnApprove.Visible = true;
                    //btnApprove.Location = new Point(398, 351);
                    btnSaveCompanySetup.BringToFront();
                    btnClose.BringToFront();
                    //return;
                }

                //added by: Bhavana on May 5, 2014
                //purpose: To show Approve button for Master fund and Account setup UI.
                if (tbcCompanySetup.Tabs["tbpMasterFunds"].Selected || tbcCompanySetup.Tabs["tbcAccountSetup"].Selected)
                {
                    btnApprove.Visible = true;
                    //btnClose.Location = new Point(439, 523);
                    // return;
                }

                // At JIRA : 646
                if (tbcCompanySetup.Tabs["tbpReleaseSetup"].Selected)
                {
                    groupBox6.Visible = false;
                    btnAdd.Visible = false;
                    btnDelete.Visible = false;
                }
                //CHMW-2221	[Implementation] import dashboard updates-Part 1
                if (tbcCompanySetup.Tabs["tbpImportTag"].Selected)
                {
                    groupBox6.Visible = false;
                    btnAdd.Visible = false;
                    btnDelete.Visible = false;
                }
                if (tbcCompanySetup.Tabs["tbpCopyPreferences"].Selected)
                {
                    DisableButtonForPreferencesTab();
                }
            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
        }

        private void tbcCompanyMaster_SelectedTabChanged(object sender, Infragistics.Win.UltraWinTabControl.SelectedTabChangedEventArgs e)
        {
            try
            {
                //const int C_TAB_COMPANYSETUP = 0;
                //const int C_TAB_COMPANYCOUNTERPARTIES = 1;
                //const int C_TAB_COMPANYUSER = 2;
                //const int C_TAB_COMPANYCLIENTS = 3;
                //const int C_TAB_COMPANYTHIRDPARTIES = 4;
                //const int C_TAB_COMPANYCOMMISSIONS = 5;
                groupBox6.Visible = true;
                btnAdd.Visible = true;
                btnDelete.Visible = true;
                btnAdd.Enabled = true;
                btnDelete.Enabled = true;
                if (tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYSETUP]
                    || tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYTHIRDPARTIES]
                    || tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYCOUNTERPARTIES]
                    || tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYCOMMISSIONS])
                {
                    trvCompanyMaster.Visible = true;
                    trvAccountGroups.Visible = false;
                    trvUsers.Visible = false;

                }
                else
                {
                    trvCompanyMaster.Visible = true;
                    trvAccountGroups.Visible = false;
                    trvUsers.Visible = false;
                }

                if (trvCompanyMaster.SelectedNode != null)
                {
                    NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;

                    if (nodeDetails.Type == NodeType.RoutingLogic)
                    {
                        if ((nodeDetails.Type != NodeType.Company) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYDETAIL])
                        {
                            trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent;
                        }
                        if ((nodeDetails.Type != NodeType.Users) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYUSER])
                        {
                            trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Nodes[1];
                        }
                        if ((nodeDetails.Type != NodeType.CounterParties) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYCOUNTERPARTIES])
                        {
                            trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Nodes[0];
                        }
                        if ((nodeDetails.Type != NodeType.Clients) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYCLIENTS])
                        {
                            trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Nodes[2];
                        }
                        if ((nodeDetails.Type != NodeType.ThirdParty) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYTHIRDPARTIES])
                        {
                            trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Nodes[3];
                        }
                    }
                    else
                    {
                        if (nodeDetails.NodeID == int.MinValue && nodeDetails.CompanyID == int.MinValue)
                        {
                            return;
                        }
                        if (nodeDetails.NodeID == int.MinValue) //Have to c for the exception here when we click on the tab while selecting the tree in CVDetail.
                        {//Either of Users/Counterparties/Clients nodes is selected.

                            if ((nodeDetails.Type != NodeType.Company) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYSETUP])
                            {
                                if (nodeDetails.Type == NodeType.CounterPartyVenues)
                                {
                                    trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Parent.Parent;
                                }
                                else
                                {
                                    trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent;
                                }
                            }
                            if ((nodeDetails.Type != NodeType.Users) && tbcCompanyMaster.SelectedTab == tbcCompanyMaster.Tabs[C_TAB_COMPANYUSER])
                            {
                                if (nodeDetails.Type == NodeType.CounterPartyVenues)
                                {
                                    trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Parent.Parent.Nodes[1];
                                }
                                else
                                {
                                    trvCompanyMaster.SelectedNode = trvCompanyMaster.SelectedNode.Parent.Nodes[1];
