        private void btnSaveCompanyThirdParty_Click(object sender, System.EventArgs e)
        {
            try
            {
                int thirdPartyID = int.MinValue;
                NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                thirdPartyID = nodeDetails.NodeID;

                ThirdPartyPermittedAccounts thirdPartyPermittedAccounts = new ThirdPartyPermittedAccounts();
                if (columnPreferenceControl1.DisplayedColumns.Count > 0)
                {
                    for (int i = 0, count = columnPreferenceControl1.DisplayedColumns.Count; i < count; i++)
                    {
                        string data = columnPreferenceControl1.DisplayedColumns[i].ToString();
                        Prana.Admin.BLL.Account account = CompanyManager.GetAccountDetail(data);
                        ThirdPartyPermittedAccount thirdPartyPermittedAccount = new ThirdPartyPermittedAccount();
                        thirdPartyPermittedAccount.CompanyAccountID = account.CompanyAccountID;
                        thirdPartyPermittedAccounts.Add(thirdPartyPermittedAccount);
                    }
                    int result = ThirdPartyDataManager.SaveThirdPartyPermittedAccounts(thirdPartyPermittedAccounts, thirdPartyID);
                    if (result > 0)
                    {
                        MessageBox.Show("The Data is Saved.");
                    }
                    else
                    {
                        MessageBox.Show("The data could not be saved.Contact Administrator.");
                    }
                }
                else
                {
                    MessageBox.Show("Please select Accounts for the Third Party before saving!");
                }


            }
            catch (Exception ex)
            {
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);

                if (rethrow)
                {
                    throw;
                }
            }

        }

