        private void cmbCountry_ValueChanged(object sender, System.EventArgs e)
        {
            if (cmbCountry.Value != null)
            {
                int countryID = int.Parse(cmbCountry.Value.ToString());
                if (countryID > 0)
                {
                    //GetStates method fetches the existing states from the database.
                    States states = GeneralManager.GetStates(countryID);
                    if (states.Count > 0)
                    {
                        states.Insert(0, new State(int.MinValue, C_COMBO_SELECT, int.MinValue));
                        cmbState.DisplayMember = "StateName";
                        cmbState.ValueMember = "StateID";
                        cmbState.DataSource = null;
                        cmbState.DataSource = states;
                        cmbState.Text = C_COMBO_SELECT;
                        foreach (Infragistics.Win.UltraWinGrid.UltraGridColumn column in cmbState.DisplayLayout.Bands[0].Columns)
                        {
                            if (column.Key.Equals("StateName"))
                            {
                                column.Hidden = false;
                            }
                            else
                            {
                                column.Hidden = true;
                            }
                        }
                        cmbState.DisplayLayout.Bands[0].ColHeadersVisible = false;
                    }
                }
                else
                {
                    BindEmptyStates();
                }

            }
        }

        private void btnMPIDDelete_Click(object sender, System.EventArgs e)
        {
            if (grdMPID.ActiveRow != null)
            {
                if (MessageBox.Show(this, "Do you want to delete this selected MPID?", "MPID Delete", MessageBoxButtons.YesNo) == DialogResult.Yes)
                {
                    MPID mpid = new MPID();
                    MPIDCollection mpidCollection = (MPIDCollection)grdMPID.DataSource;
                    int companyMPID = int.Parse(grdMPID.ActiveRow.Cells["CompanyMPID"].Value.ToString());

                    mpid.CompanyMPID = int.Parse(grdMPID.ActiveRow.Cells["CompanyMPID"].Value.ToString());
                    mpid.MPIDName = grdMPID.ActiveRow.Cells["MPIDName"].Text.ToString();
                    mpid.CompanyID = int.Parse(grdMPID.ActiveRow.Cells["CompanyID"].Value.ToString());

                    foreach (MPID mpidTemp in mpidCollection)
                    {
                        if (mpid.CompanyMPID == mpidTemp.CompanyMPID && mpid.MPIDName == mpidTemp.MPIDName && mpid.CompanyID == mpidTemp.CompanyID)
                        {
                            mpid = mpidTemp;
                            break;
                        }
                    }

                    if (companyMPID != int.MinValue)
                    {
                        bool result = false;
                        result = CompanyManager.DeleteCompanyMPIDByID(companyMPID);
                        if (result == false)
                        {
                            //Not deleted
                        }
                        else
                        {
                            //accounts.RemoveAt(accounts.IndexOf(account));
                        }
                    }
                    //					else
                    //					{
                    mpidCollection.Remove(mpid);
                    //					}
                    grdMPID.DataSource = mpidCollection;
                }
            }
        }

