            {
                if (tbcCompanyThirdParty.SelectedTab == tbcCompanyThirdParty.Tabs[1])
                {
                    NodeDetails nodeDetails = (NodeDetails)trvCompanyMaster.SelectedNode.Tag;
                    int thirdPartyID = int.MinValue;
                    thirdPartyID = nodeDetails.NodeID;

                    uctCompanyThirdPartyMappingDetails.ThirdPartyID = thirdPartyID;
                    uctCompanyThirdPartyMappingDetails.CompanyID = nodeDetails.CompanyID;
                    //////getting and setting the ThirdParty Accounts Mapping Details .
                    ThirdPartyAccounts thirdPartyAccounts = CompanyManager.GetCompanyThirdPartyMappingDetails(thirdPartyID);
