        /// <summary>
        /// Save changes in DB on close
        /// Modified by omshiv, 15 may 2014
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void CompanyMaster_FormClosing(object sender, FormClosingEventArgs e)
        {
            try
            {
                bool r = false;

                //If save allowed to user then only ask for save on exit. 
                if (btnSave.Enabled)
                {

                    //Save Master fund mapping 
                    if (tbcCompanySetup.SelectedTab.Key == "tbpMasterFunds")
                    {

                        r = uctMasterFundMapping.uBtnCancel_Click();
                    }
                    //Save Master Strategy mapping 
                    if (tbcCompanySetup.SelectedTab.Key == "tbpMasterStrategy")
                    {
                        r = masterStrategyMapping1.uBtnCancel_Click();
                    }

                    //Save Feeder account accounts 
                    if (feederAccountSetup1._isSaveRequired)
                    {
                        DialogResult dr = MessageBox.Show("Feeder details not saved. Save the details now?", "Alert", MessageBoxButtons.YesNoCancel, MessageBoxIcon.Warning);
                        if (dr == DialogResult.Yes)
                        {
                            feederAccountSetup1.SaveData();
                        }
                        else if (dr == DialogResult.Cancel)
                        {
                            r = true;
                        }
                    }

                    //Save Account Setup details 
                    r = accountSetup1.SaveBeforeClose();

                    //Save Pricing rules 
                    if (pricingRules1._isSaveRequired)
                    {
                        DialogResult dr = MessageBox.Show("Pricing details not saved. Save the details now?", "Alert", MessageBoxButtons.YesNoCancel, MessageBoxIcon.Warning);

                        if (dr == DialogResult.Yes)
                        {
                            pricingRules1.SavePricingDetails();
                        }
                        else if (dr == DialogResult.Cancel)
                        {
                            r = true;
                        }
                    }
                    // Modified by Ankit Gupta on 15 Sep, 2014
                    // http://jira.nirvanasolutions.com:8080/browse/CHMW-1394
                    // If some changes have been made in permission mappings, prompt the user to save the changes.
                    if (ctrlUserPermissions1._isSaveRequired)
                    {
                        DialogResult dr = MessageBox.Show("Permission mapping details not saved. Save the details now?", "Alert", MessageBoxButtons.YesNoCancel, MessageBoxIcon.Warning);

                        if (dr == DialogResult.Yes)
                        {
                            if (ctrlUserPermissions1.HasEmpty())
                            {
                                MessageBox.Show("Blank permissions cannot be added.", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Error);
                                r = true;
                            }
                            else
                            {
                                int countSave = ctrlUserPermissions1.SavePermissions();
                                if (countSave > 0)
                                {
                                    MessageBox.Show("Permission details saved", "Success", MessageBoxButtons.OK, MessageBoxIcon.Information);
                                    //AuthorizationManager.GetInstance().RefreshUserPermissions();
                                }
                            }
                        }
                        else if (dr == DialogResult.Cancel)
                        {
                            r = true;
                        }
                    }
                }

                // if user cancel closing
                if (r == true)
                {
                    e.Cancel = true;
                }

            }
            catch (Exception ex)
            {
                // Invoke our policy that is responsible for making sure no secure information
                // gets out of our layer.
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }
        }

