        private void BindAUECIDCombo()
        {



            string AUNames = string.Empty;
            string AUID = string.Empty;

            foreach (var user in _dictUser)
            {
                Prana.BusinessObjects.Assets assets = WindsorContainerManager.GetCompanyUserAssets(user.Key);

                Prana.BusinessObjects.UnderLyings underlyings = WindsorContainerManager.GetUnderLyingsByUserID(user.Key);

                Prana.BusinessObjects.AUECs companyUserAUECs = WindsorContainerManager.GetCompanyUserAUECDetails(user.Key);

                foreach (Prana.BusinessObjects.AUEC auec in companyUserAUECs)
                {
                    AUNames = auec.UnderLying.Name + "-" + auec.Asset.Name;
                    AUID = auec.Asset.AssetID.ToString() + "/" + auec.UnderLying.UnderlyingID.ToString();
                    if (!_dictAUECids.ContainsValue(AUNames) && !_dictAUECids.ContainsKey(AUID))
                    {
                        _dictAUECids.Add(AUID, AUNames);
                    }

                }
            }
            multiselectcmbAUEC.ClearAll();
            multiselectcmbAUEC.SetTextEditorText("No  AUEC(s) Selected");
            multiselectcmbAUEC.AddItemsToTheCheckList(_dictAUECids, CheckState.Unchecked);

            cmbFromAuecID.DataSource = null;
            cmbFromAuecID.DataSource = new BindingSource(_dictAUECids, null);
            cmbFromAuecID.DisplayMember = "Value";
            cmbFromAuecID.ValueMember = "Key";
        }

