        private void SavePreferences()
        {
            try
            {
                Dictionary<string, string> dictSelectedAUECIds = multiselectcmbAUEC.GetSelectedItemsInDictionaryinString();
                string selectedAssetIDs = string.Empty;
                string selectedUnderlyingIDs = string.Empty;
                _prefstatus = true;
                if (rdbtnSavePreferences.Checked)
                {
                    string users = (multiselectcmbUser.GetCommaSeperatedAccountIds());
                    string counterPartys = multiselectcmbCounterParty.GetCommaSeperatedAccountIds();
                    string venues = multiselectcmbVenue.GetCommaSeperatedAccountIds();
                    string Auids = multiselectcmbAUEC.GetCommaSeperatedIds();
                    if (dictSelectedAUECIds.Count != 0 && counterPartys != string.Empty && venues != string.Empty && users != string.Empty)
                    {
                        object[] parameter = new object[21];
                        parameter[0] = users.Remove(users.Length - 1);
                        parameter[1] = Auids.Remove(Auids.Length - 1);
                        parameter[2] = counterPartys.Remove(counterPartys.Length - 1);
                        parameter[3] = venues.Remove(venues.Length - 1);
                        parameter[4] = cmbAccount.Value;
                        parameter[5] = cmbTradingAccount.Value;
                        parameter[6] = cmbStrategy.Value;
                        parameter[7] = txtQuantity.Value.ToString();
                        parameter[8] = txtDisplayQuantity.Value.ToString();
                        parameter[9] = txtQuantityIncrement.Value.ToString();
                        parameter[10] = txtPriceLimitIncrement.Value.ToString();
                        parameter[11] = txtStopPriceIncrement.Value.ToString();
                        parameter[12] = txtPegOffset.Value.ToString();
                        parameter[13] = txtDiscrOffset.Value.ToString();
                        parameter[14] = cmbOrderType.Value;
                        parameter[15] = cmbExecutionInstruction.Value;
                        parameter[16] = cmbHandlingInstruction.Value;
                        parameter[17] = cmbTIF.Value;
                        parameter[18] = cmbOrderSide.Value.ToString();
                        parameter[19] = Convert.ToInt32(cmbSettlCurrency.Value);
                        parameter[20] = defaultQuantityChkBox.Checked;
                        CompanyManager.SaveTTPreferencesForMultipleUsers(parameter, 0);
                    }
                    else
                    {
                        _prefstatus = false;
                        MessageBox.Show(this, "Please select atleast one value.", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                }

                else
                {
                    string users = (multiselectcmbUser.GetCommaSeperatedAccountIds());
                    if (users != string.Empty && cmbFromAuecID.SelectedIndex != -1 && cmbFromCounterParty.SelectedIndex != -1 && cmbFromUser.SelectedIndex != -1 && cmbFromVenue.SelectedIndex != -1)
                    {
                        string allCounterPartyIds = string.Empty;
                        string allVenueIds = string.Empty;
                        object[] parameter = new object[9];
                        selectedAssetIDs = string.Empty;
                        selectedUnderlyingIDs = string.Empty;
                        string Auids = GetAllCommaSeperatedKeys(_dictAUECids);
                        allCounterPartyIds = GetAllCommaSeperatedKeys(_dictCounterParty);
                        allVenueIds = GetAllCommaSeperatedKeys(_dictVenues);

                        string AssetsAndUnderlying;
                        string[] AssetsAndUnderlying1;
                        AssetsAndUnderlying = cmbFromAuecID.Value.ToString();
                        AssetsAndUnderlying1 = AssetsAndUnderlying.Split('/');
                        parameter[0] = users.Remove(users.Length - 1);
                        parameter[1] = Auids.Remove(Auids.Length - 1);
                        parameter[2] = allCounterPartyIds.Remove(allCounterPartyIds.Length - 1);
                        parameter[3] = allVenueIds.Remove(allVenueIds.Length - 1);
                        parameter[4] = cmbFromUser.Value;
                        parameter[5] = AssetsAndUnderlying1[0];
                        parameter[6] = AssetsAndUnderlying1[1];
                        parameter[7] = cmbFromCounterParty.Value;
                        parameter[8] = cmbFromVenue.Value;
                        CompanyManager.SaveTTPreferencesForMultipleUsers(parameter, 1);
                    }
                    else
                    {
                        _prefstatus = false;
                        MessageBox.Show(this, "Please select atleast one value.", "Alert", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                }

            }
            catch (Exception ex)
            {
                bool rethrow = Logger.HandleException(ex, LoggingConstants.POLICY_LOGANDSHOW);
                if (rethrow)
                {
                    throw;
                }
            }


        }

        private string GetAllCommaSeperatedKeys(Dictionary<string, string> dictIds)
        {
            string ids = string.Empty;
            foreach (var kvp in dictIds)
            {
